function ForecastWeatherCard(props) {
    const { days } = props
    return (
        <div className="ForecastWeatherCard">
            {days.map((day) => {
                return (
                    <div key="day">{day.day} {day.min}~{day.max} {day.huminity}</div>
                )
            })}
        </div>
    );
}

export default ForecastWeatherCard;
